import pytest
import requests
from datetime import datetime, timedelta
from unittest.mock import Mock, patch

from src.data_collection.weather_api import WeatherDataCollector


@pytest.fixture
def collector():
    return WeatherDataCollector(api_key="test_key")


def test_collector_initialization(collector):
    """测试初始化"""
    assert collector.api_key == "test_key"
    assert len(collector.cities) > 0


@patch('requests.get')
def test_fetch_current_weather(mock_get, collector):
    """测试获取当前天气"""
    mock_response = Mock()
    mock_response.json.return_value = {
        "code": "200",
        "now": {
            "temp": "25",
            "windSpeed": "3",
            "precip": "0.0",
            "windDir": "东南风"
        }
    }
    mock_response.raise_for_status = Mock()
    mock_get.return_value = mock_response

    result = collector.fetch_current_weather("广州")

    assert result is not None
    assert 'temp' in result


@patch('requests.get')
def test_fetch_forecast_weather(mock_get, collector):
    """测试获取天气预报"""
    mock_response = Mock()
    mock_response.json.return_value = {
        "code": "200",
        "hourly": [
            {"fxTime": "2025-07-01T00:00+08:00", "temp": "24", "windSpeed": "2"},
            {"fxTime": "2025-07-01T01:00+08:00", "temp": "23", "windSpeed": "2"},
        ]
    }
    mock_response.raise_for_status = Mock()
    mock_get.return_value = mock_response

    result = collector.fetch_forecast_weather("广州", hours=24)

    assert result is not None
    assert len(result) > 0


def test_get_city_id(collector):
    """测试城市ID获取"""
    city_id = collector._get_city_id("广州")
    assert city_id == "101280101"

    city_id = collector._get_city_id("深圳")
    assert city_id == "101280601"


def test_get_city_id_invalid(collector):
    """测试不支持的城市"""
    with pytest.raises(ValueError):
        collector._get_city_id("不存在的城市")


@patch('requests.get')
def test_fetch_current_weather_error_code(mock_get, collector):
    """测试API错误码处理"""
    mock_response = Mock()
    mock_response.json.return_value = {
        "code": "400",
        "message": "Invalid API key"
    }
    mock_response.raise_for_status = Mock()
    mock_get.return_value = mock_response

    result = collector.fetch_current_weather("广州")
    assert result is None


@patch('requests.get')
def test_fetch_current_weather_request_error(mock_get, collector):
    """测试网络请求错误处理"""
    mock_get.side_effect = requests.exceptions.RequestException("Network error")

    result = collector.fetch_current_weather("广州")
    assert result is None
